import React from 'react';
import { Outlet, Link } from "react-router-dom";

function Nav() {
  return (
    <>
      <nav>
      <ul>
        <li>
          <Link to="/">BurgerBuilder</Link>
        </li>
        <li>
          <Link to="/blogs">Blogs</Link>
        </li>
        <li>
          <Link to="/contact">Contact</Link>
        </li>
      </ul>
      </nav>
  </>
    );
}
export default Nav;
